import React from 'react'
import {Wrapper, Paragraph, H2} from '../Styled'
import styled from 'styled-components'
import MinimalIcon from '@material-ui/icons/FiberManualRecord';
import MobileIcon from '@material-ui/icons/PhoneIphone';
import ComponentIcon from '@material-ui/icons/Cached';


const CardContainer = styled(Wrapper)`
    width: 100%;
    display:flex;
    flex-direction:row;
`

const ValueCard = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:space-around;
    height:20em;
    width:15em;
` 

export default function Values() {
    return (
        <CardContainer>
            <ValueCard>
                <MinimalIcon/>
                <H1>minimal</H1>
                <Paragraph>

                </Paragraph>
            </ValueCard>
            <ValueCard>
                <MobileIcon/>
                <H2>mobile first </H2>
                <Paragraph>

                </Paragraph>
            </ValueCard>
            <ValueCard>
                <ComponentIcon/>
                <H2>component based </H2>
                <Paragraph>

                </Paragraph>
            </ValueCard>
        </CardContainer>
    )
}
